# syscall constants
PRINT_STRING		= 4
PRINT_CHAR		= 11
PRINT_INT		= 1

# memory-mapped I/O
VELOCITY		= 0xffff0010
ANGLE			= 0xffff0014
ANGLE_CONTROL		= 0xffff0018

BOT_X			= 0xffff0020
BOT_Y			= 0xffff0024
GET_OPPONENT_HINT	= 0xffff00ec

TIMER			= 0xffff001c
ARENA_MAP		= 0xffff00dc

SHOOT_UDP_PACKET	= 0xffff00e0
GET_BYTECOINS		= 0xffff00e4
USE_SCANNER		= 0xffff00e8

REQUEST_PUZZLE		= 0xffff00d0  ## Puzzle
SUBMIT_SOLUTION		= 0xffff00d4  ## Puzzle

BONK_INT_MASK		= 0x1000
BONK_ACK		= 0xffff0060

TIMER_INT_MASK		= 0x8000
TIMER_ACK		= 0xffff006c

REQUEST_PUZZLE_INT_MASK = 0x800       ## Puzzle
REQUEST_PUZZLE_ACK	= 0xffff00d8  ## Puzzle

RESPAWN_INT_MASK	= 0x2000      ## Respawn
RESPAWN_ACK		= 0xffff00f0  ## Respawn

# our constants
MAX_SOLUTION_SIZE = 68	# num_rows = 13, num_cols = 5 = 65 -> 17 lw/sw -> stop at 68
MAX_PUZZLE_SIZE = 80	# MAX_SOLUTION_SIZE + num_rows + num_cols + num_colors = 65 + 12 = 77 -> 20 lw/sw -> stop at 80
SOLVE_SLOWDOWN_CYCLES = 0
MAX_XY_TILES = 39

SWEEP_DELAY_INTERVAL = 12250
SWEEP_SHOOT_CYCLES = 900

SWEEP_SHOOT_ANGLE = 3

RESPAWN_FLIPS_DIRECTION = 2				# 0 -> Flips, 2 -> Does not flip. Use 2 for old size 16 respawn_pointers

.data

# Instruction memory is at bottom of file
# Respawn pointers are at bottom of file
# Auto-generated by gen_inst.py <inst.txt> -r spimbot.s

# Puzzle solver lookup table is at bottom of file
# Puzzle dimension id lookup table is at bottom of file
# Auto-generated by puzzle/generate_lookup.py -r spimbot.s

current_move: .word 0

remaining_sweep_delay_cycles: .word 0

### Puzzle main loop

### Arena Map Check
fire_udp_rounds: .word 0

### Arena Map
arena_map: .byte 0:1600

### Scanner
scanner_wb:
hit_x: .byte 0
hit_y: .byte 0
tile_type: .byte 0

### Other
is_blue_bot: .word 0
respawn_direction: .word RESPAWN_FLIPS_DIRECTION	# Upon respawn, this becomes 1. When respawn_direction is 1, the bot
							# starts the current instruction at respawn_pointers[host_index + 16]
							# so that it moves in a different direction from the previous respawn

#############
# Main code #
#############
.text
main:
	# Construct interrupt mask
	li	$t4, 1					# global enable bit
	or	$t4, $t4, REQUEST_PUZZLE_INT_MASK	# puzzle interrupt bit
	or	$t4, $t4, RESPAWN_INT_MASK		# respawn interrupt bit
	or	$t4, $t4, TIMER_INT_MASK		# timer interrupt bit
	mtc0	$t4, $12

	# Setup code
	lw	$t0, BOT_X				# Identify if red or blue bot via starting location
	sgt	$t1, $t0, 160				# true if starting on the right half of the map
	sw	$t1, is_blue_bot			# Important for orientation of angle and movement

	sw	$zero, TIMER				# Kick off kernel instruction loop immediately

main_all_solve_setup:					# Breaks all calling conventions in the interest of saving cycles
	la	$a3, puzzle_board			# in the hot loop. These registers will be used in toggle lights

main_first_request_puzzle:
	la	$t0, REQUEST_PUZZLE

	la	$s0, puzzle				# Puzzle address
	sw	$s0, ($t0)				# Request puzzle

	la	$s1, puzzle_queued			# Queued puzzle address
	sw	$s1, ($t0)				# Request queued puzzle

	la	$t2, has_received_puzzle
main_first_check_puzzle_available:
	lw	$t1, ($t2)				# Check first puzzle available by checking has_received_puzzle
	beq	$t1, $zero, main_first_check_puzzle_available

	sw	$zero, ($t2)				# Reset has_received_puzzle

main_first_puzzle_solve:
	jal	solve

	la	$s2, solution				
	la	$s4, SUBMIT_SOLUTION
	sw	$s2, ($s4)				# Submit solution

main_loop_solve_setup:
	li	$s3, MAX_SOLUTION_SIZE
	add	$s3, $s3, $s2				# $s3 = last address (exclusive) for solution

	li	$s5, MAX_PUZZLE_SIZE
	add	$s5, $s5, $s0				# $s5 = last address (exclusive) for puzzle

main_loop_solve:
main_loop_reset_setup:
	#la	$s0, puzzle
	#la	$s1, puzzle_queued
	#la	$s2, solution				# already done and will be done at the end of the loop

	la	$t2, has_received_puzzle
main_loop_check_puzzle_available:
	lw	$t1, ($t2)				# Check first puzzle available by checking has_received_puzzle
	beq	$t1, $zero, main_loop_check_puzzle_available

	sw	$zero, ($t2)				# Reset has_received_puzzle

main_loop_reset_solution_and_copy_puzzle_for:
	sw	$zero, ($s2)				# solution[i] = 0

	lw	$t0, ($s1)				# load from queued puzzle
	sw	$t0, ($s0)				# copy to puzzle to be solved

	add	$s0, $s0, 4				# puzzle += 4
	add	$s1, $s1, 4				# puzzle_queued += 4
	add	$s2, $s2, 4				# solution += 4

	# Minimal possible size (not 256) to avoid spending too much time clearing solution
	bne	$s2, $s3, main_loop_reset_solution_and_copy_puzzle_for

main_loop_reset_copy_puzzle_for:
	lw	$t0, ($s1)				# load from queued puzzle
	sw	$t0, ($s0)				# copy to puzzle to be solved

	add	$s0, $s0, 4				# puzzle += 4
	add	$s1, $s1, 4				# puzzle_queued += 4

	bne	$s0, $s5, main_loop_reset_copy_puzzle_for	# puzzle and puzzle_queued are same size so only need to check one pointer for loop condition

	la	$s1, puzzle_queued
	sw	$s1, REQUEST_PUZZLE			# request new queued puzzle

	jal	solve					# Call solver

	la	$s2, solution
	sw	$s2, ($s4)				# Submit solution

	la	$s0, puzzle				# Reset puzzle address

	j	main_loop_solve				# User-space code solves puzzles forever (Kernel code does the movement)

main_end:
	jr	$ra

###############
# Kernel code #
###############
.kdata
chunkIH: .space 80
non_intrpt_str: .asciiz "Non-interrupt exception\n"
unhandled_str:  .asciiz "Unhandled interrupt type\n"

.ktext 0x80000180
interrupt_handler:
.set noat
	move	$k1, $at			# Save $at
						# NOTE: Don't touch $k1 or else you destroy $at!
.set at
	la	$k0, chunkIH
	sw	$a0, 0($k0)			# Get some free registers
	sw	$v0, 4($k0)			# by storing them to a global variable
	sw	$t0, 8($k0)
	sw	$t1, 12($k0)
	sw	$t2, 16($k0)
	sw	$t3, 20($k0)
	sw	$t4, 24($k0)
	sw	$t5, 28($k0)
	sw	$t6, 32($k0)
	sw	$t7, 36($k0)
	sw	$t8, 40($k0)
	sw	$t9, 44($k0)
	sw	$ra, 48($k0)

	# Save coprocessor1 registers!
	# If you don't do this and you decide to use division or multiplication
	#   in your main code, and interrupt handler code, you get WEIRD bugs.
	mfhi	$t0
	sw	$t0, 52($k0)
	mflo	$t0
	sw	$t0, 56($k0)

	mfc0	$k0, $13			# Get Cause register
	srl	$a0, $k0, 2
	and	$a0, $a0, 0xf			# ExcCode field
	bne	$a0, 0, non_intrpt

interrupt_dispatch:				# Interrupt:
	mfc0	$k0, $13			# Get Cause register, again
	beq	$k0, 0, done			# handled all outstanding interrupts

	and	$a0, $k0, TIMER_INT_MASK	# is there a timer interrupt?
	bne	$a0, 0, timer_interrupt

	and	$a0, $k0, REQUEST_PUZZLE_INT_MASK
	bne	$a0, 0, request_puzzle_interrupt

	and	$a0, $k0, RESPAWN_INT_MASK
	bne	$a0, 0, respawn_interrupt

	li	$v0, PRINT_STRING		# Unhandled interrupt types
	la	$a0, unhandled_str
	syscall
	j	done

### Movement Pattern
# -360 to 360		absolute angle
# 1500 +- v		velocity
# 2000			UDP, may be contingent on previous check of arena map
# 3000 + (x << 6) + y	Check arena map at x, y and set flag for next UDP
# 6000			Sweep shoot
# 10000000 + cm		Set current_move to cm
# 20000000		End program
# 100000000 + c		Delay c cycles
# 200000000 + c		Delay c cycles and sweep shoot at the beginning and during the delay

timer_interrupt:
	sw	$zero, TIMER_ACK

	lw	$t9, remaining_sweep_delay_cycles	# load # of sweep delay cycles left
check_sweep_delay:
	ble	$t9, SWEEP_SHOOT_CYCLES, finish_sweep_delay_cycles

	lw	$t8, VELOCITY			# store current velocity
	sw	$zero, VELOCITY			# stop moving
	lw	$t1, ANGLE			# store current angle

	jal	execute_sweep_shoot_during_delay	# we don't follow calling conventions here ;) execute_sweep_shoot... uses $t2 through $t7

	li	$t3, SWEEP_DELAY_INTERVAL	# load sweep delay interval (# of cycles in between sweeps in the middle of a sweep_delay)
	blt	$t3, $t9, store_delay		# if sweep delay interval less than # of remaining cycles store that directly

	move	$t3, $t9			# otherwise store # of remaining cycles in sweep_delay

store_delay:
	sub	$t9, $t9, $t3			# update remaining sweep delay cycles
	sw	$t9, remaining_sweep_delay_cycles	# store


	lw	$t4, TIMER			# get current cycle
	add	$t4, $t4, $t3			# next timer intrpt at current cycle + either interval delay or remaining sweep delay cycles

	sw	$t4, TIMER			# request timer interrupt

	sw	$t1, ANGLE			# restore previous angle
	li	$t1, 1
	sw	$t1, ANGLE_CONTROL		# restore previous angle ("absolute")
	sw	$t8, VELOCITY			# restore previous velocity

	j	interrupt_dispatch		# return control

finish_sweep_delay_cycles:
	sub	$t9, $t9, 2			# finish out the remaining sweep delay cycles doing nothing while we are moving
	bgtz	$t9, finish_sweep_delay_cycles

	sw	$zero, VELOCITY			# ?? explicitly stop even though IML opcode 1500 takes care of this

execute_normal_instruction:
	lw	$t0, current_move		# load instruction counter

# INSTRUCTION
execute_until_delay:				# main instruction loop that hands control back to user when delaying
	lw	$t1, movement($t0)		# load instruction

	add	$t0, $t0, 4			# increment instruction counter

no_debug:
	blt	$t1, 1000, execute_angle	# branches to appropriate instruction handler
	blt	$t1, 2000, execute_velocity	# depending on range of instruction (think of it like a weird
	beq	$t1, 2000, execute_udp		# opcode that works with integer ranges instead of bits)
	beq	$t1, 6000, execute_sweep_shoot
	blt	$t1, 10000000, execute_hostcheck
	beq	$t1, 20000000, return_end
	blt	$t1, 100000000, execute_jump
	blt	$t1, 200000000, return_delay
	j	return_sweep_delay		# TODO: MOVE THIS UP!

# INSTRUCTION
execute_angle:					# set angle
	lw	$t9, is_blue_bot		# orientation matters
	beq	$t9, $zero, angle_write		# don't add 180 if starting top-left (red bot)

	add	$t1, $t1, 180			# fall-through to adding 180 for starting bottom-right (blue bot)
						# (angle comes direct from cmd parameter since no opcode offset)
	#rem	$t1, $t1, 360			# ensure angle is within -360 to 360 (necessary??)

angle_write:
	sw	$t1, ANGLE
	li	$t2, 1
	sw	$t2, ANGLE_CONTROL		# 1 = "absolute" angle control and store confirms and sets angle
	j	execute_until_delay

# INSTRUCTION
execute_velocity:				# set velocity
	sub	$t2, $t1, 1500			# subtract opcode offset
	sw	$t2, VELOCITY
	j	execute_until_delay

# INSTRUCTION
execute_udp:					# fire certain number of udp rounds (as set by hostcheck)
	lw	$t9, fire_udp_rounds

udp_fire:
	beq	$t9, $zero, udp_done
	sw	$zero, SHOOT_UDP_PACKET
	sub	$t9, $t9, 1
	j	udp_fire

udp_done:
	sw	$zero, fire_udp_rounds

	j	execute_until_delay

# INSTRUCTION
execute_sweep_shoot:
	la	$ra, execute_until_delay

execute_sweep_shoot_during_delay:
	li 	$t2, SWEEP_SHOOT_ANGLE
	li	$t3, 360
	li	$t4, 1				# t2 = angle jump, t3 = angle end, t4 = absolute angle control
	la 	$t5, scanner_wb

	li 	$t7, 24				# enemy player

loop_sweep:
	sw	$t3, ANGLE
	sw	$t4, ANGLE_CONTROL		# 1 = "absolute" angle control and store confirms and sets angle
	# Maybe make this relative? For sweep delay to not have to restore

	sw 	$t5, USE_SCANNER
	
	lb 	$t6, tile_type
	bne 	$t6, $t7, finish_loop_sweep

	sw	$zero, SHOOT_UDP_PACKET

	# Must restore original angle
	j 	$ra

finish_loop_sweep:
	sub 	$t3, $t3, $t2
	bgtz	$t3, loop_sweep
	j 	$ra

# INSTRUCTION
execute_hostcheck:				# hostcheck sets appropriate # of UDP
	la	$t5, arena_map			# packets to fire at the host at given (x, y)
	sw	$t5, ARENA_MAP

	sub	$t2, $t1, 3000			# command offset
	srl	$t3, $t2, 6			# x-tile (NOT pixel!)
	and	$t4, $t2, 0x3f			# y-tile (NOT pixel!)

	lw	$t9, is_blue_bot		# orientation matters
	beq	$t9, $zero, hostcheck_no_reflect# don't change tile if red bot

	li	$t5, MAX_XY_TILES
	sub	$t3, $t5, $t3			# fall-through to reflecting tile *about the origin*
	sub	$t4, $t5, $t4			# (i.e. x = 39 - x; y = 39 - y)

hostcheck_no_reflect:
	mul	$t4, $t4, 40			# map[y][x] == map[y * 40 + x]
	add	$t3, $t3, $t4			# index at $t3

	li	$t9, 0				# number of shots to fire

	lb	$t6, arena_map($t3)		# load tile type

	and	$t7, $t6, 4			# check friendly host
	bne	$t7, $zero, hostcheck_add_0	# branch if friendly host

	and	$t8, $t6, 8			# check enemy host
	beq	$t8, $zero, hostcheck_add_1	# branch if neutral host

	# enemy host: fall-through to 2 total shots

	add	$t9, $t9, 1			# 2 total shots if enemy

hostcheck_add_1:
	add	$t9, $t9, 1			# 1 total shot if neutral

hostcheck_add_0:
	sw	$t9, fire_udp_rounds		# 0 shots if friendly
	j	execute_until_delay

# INSTRUCTION
execute_jump:					# unconditional jump to offset in instruction
	sub	$t0, $t1, 10000000		# subtract "opcode"
	j	execute_until_delay

# INSTRUCTION
return_delay:					# sets up a delay and returns control to user
	sub	$t1, $t1, 100000000		# subtract "opcode"
	lw	$t2, TIMER
	add	$t2, $t2, $t1			# add delay (in cycles) to current cycle count
	sw	$t2, TIMER			# request interrupt

	sw	$t0, current_move
	j	interrupt_dispatch		# see if other interrupts are waiting

# INSTRUCTION
return_sweep_delay:
	sub	$t9, $t1, 200000000		# subtract "opcode"
	#sw	$t9, remaining_sweep_delay_cycles
	sw	$t0, current_move		# store current move for instruction following entire sweep delay
	j	check_sweep_delay		# start

# INSTRUCTION
return_end:
	sw	$t0, current_move
	j	interrupt_dispatch		# see if other interrupts are waiting

request_puzzle_interrupt:
	sw	$zero, REQUEST_PUZZLE_ACK

	li	$t0, 1
	sw	$t0, has_received_puzzle	# Notify user loop

	j	interrupt_dispatch

respawn_interrupt:
	# Need to stop timer loop before acknowledging respawn to stop any
	# pending timer loop
	sw	$zero, TIMER_ACK

	# Acknowledge respawn. This puts the bot back into play
	sw	$zero, RESPAWN_ACK

	lw	$t8, BOT_X			# get current location
	lw	$t9, BOT_Y			# more details on host mapping in scripts/host_mapping.md

	srl	$t8, $t8, 3			# convert pixels to tiles (divide by 8)
	srl	$t9, $t9, 3

	lw	$t0, is_blue_bot		# orientation matters
	beq	$t0, $zero, respawn_no_reflect	# don't change tile if red bot

	li	$t1, MAX_XY_TILES
	sub	$t8, $t1, $t8			# fall-through to reflecting tile *about the origin*
	sub	$t9, $t1, $t9			# (i.e. x = 39 - x; y = 39 - y)

respawn_no_reflect:

	li	$t0, 0				# bitstring for pointer array index. Bits "3210", 0 is LSB

	li	$t6, 8				# what x will be compared to for bit 3
	li	$t7, 8				# what y will be compared to for bit 2

respawn_bit_3_x:
	blt	$t8, 16, respawn_bit_2_y
	or	$t0, $t0, 8			# set bit 3
	li	$t6, 32

respawn_bit_2_y:
	blt	$t9, 16, respawn_bit_1_0
	or	$t0, $t0, 4			# set bit 2
	li	$t7, 32

respawn_bit_1_0:
	sge	$t1, $t8, $t6			# $t1 is 0 if x < [8/32], else 1
	sge	$t2, $t9, $t7			# $t2 is 0 if y < [8/32], else 1

	sll	$t1, $t1, 1			# make $t1 into bit 1

	or	$t0, $t0, $t1			# set bit 1
	or	$t0, $t0, $t2			# set bit 0

	# flip respawn_direction
	lw	$t9, respawn_direction
	beq	$t9, 2, respawn_convert_to_offset	# If equal to 2, don't flip respawn direction and don't add 16

	not	$t9, $t9
	sw	$t9, respawn_direction

	# if respawn_direction is 1, use second half of respawn_pointers array
	# (add 16 to host_index). otherwise, use original host_index
	beq	$zero, $t9, respawn_convert_to_offset

	add	$t0, $t0, 16			# add 16 (use second half of array)

respawn_convert_to_offset:
	# convert number to offset for the int array (respawn pointers)
	sll	$t0, $t0, 2			# multiply by 4

	lw	$t5, respawn_pointers($t0)	# load in instruction to start at

	sw	$zero, remaining_sweep_delay_cycles	# reset remaining_sweep_delay_cycles so sweep_delay loop doesn't take over
	sw	$t5, current_move		# set instruction counter
	sw	$zero, TIMER			# request timer interrupt immediately so timer loop takes over

	j	interrupt_dispatch

non_intrpt:					# was some non-interrupt
	li	$v0, PRINT_STRING
	la	$a0, non_intrpt_str
	syscall					# print out an error message
						# fall through to done
done:
	la	$k0, chunkIH

	# Restore coprocessor1 registers!
	# If you don't do this and you decide to use division or multiplication
	#  in your main code, and interrupt handler code, you get WEIRD bugs.
	lw	$t0, 52($k0)
	mthi	$t0
	lw	$t0, 56($k0)
	mtlo	$t0

	lw	$a0, 0($k0)			# Restore saved registers
	lw	$v0, 4($k0)
	lw	$t0, 8($k0)
	lw	$t1, 12($k0)
	lw	$t2, 16($k0)
	lw	$t3, 20($k0)
	lw	$t4, 24($k0)
	lw	$t5, 28($k0)
	lw	$t6, 32($k0)
	lw	$t7, 36($k0)
	lw	$t8, 40($k0)
	lw	$t9, 44($k0)
	lw	$ra, 48($k0)

.set noat
	move	$at, $k1			# Restore $at
.set at
	eret


###############
# Solver code #
###############
.data
### Puzzle solver
puzzle: 
num_rows: .word 0
num_cols: .word 0
num_colors: .word 0
puzzle_board: .byte 0:256

# Queued puzzle - solved immediately after first puzzle is solved
puzzle_queued: .byte 0:268

has_received_puzzle: .word 0

solution: .byte 0:256

ENCODED_ROW_WIDTH = 10

.text
.globl solve
solve:
# Precondition: solution is filled with zeroes
# Remember to clear board inside the request loop so cycles aren't wasted
	sub	$sp, $sp, 20
	sw	$ra, 0($sp)
	sw	$s0, 4($sp) 
	sw	$s1, 8($sp)
	sw	$s2, 12($sp)
	sw	$s3, 16($sp)

	lw	$s6, num_rows			# Breaks calling conventions
	lw	$s7, num_cols			# Loads necessary puzzle-wide information for toggle_light instead of
	lw	$s8, num_colors			# passing in arguments so we can save cycles in the hot loop

	jal	chase_lights

solve_encode_puzzle_dim:
	lw	$t0, num_rows
	lw	$t1, num_cols
	lw	$t2, num_colors

	sub	$t3, $t0, 5			# row_bits = num_rows - 5
	sll	$t3, $t3, 3			# row_bits <<= 3

	sub	$t4, $t1, 4			# col_bits = num_cols - 4
	sll	$t4, $t4, 1			# col_bits <<= 1

	sub	$t5, $t2, 2			# color_bits = num_colors - 2

	add	$t6, $t3, $t4			# puzzle_dim_bits = row_bits + col_bits
	add	$t6, $t6, $t5			# puzzle_dim_bits += color_bits

	lbu	$t8, dim_id_table($t6)		# dimension_id = dim_id_table[puzzle_dim_bits]

solve_encode_bottom_row:
	sub	$s1, $t2, 1			# cell_bit_width = num_colors - 1
	li	$t4, 0				# bottom_row_bits = 0 

	sub	$t5, $t0, 1			# index (last row's index) = num_rows - 1
	mul	$t5, $t5, $t1			# index *= num_cols

	add	$t6, $t5, $t1			# end_index = index + num_cols

solve_encode_bottom_row_for:
	sll	$t4, $t4, $s1			# bottom_row_bits <<= cell_bit_width
	lbu	$t7, puzzle_board($t5)		# state = puzzle_board[index]
	add	$t4, $t4, $t7			# bottom_row_bits += state

	add	$t5, $t5, 1			# ++index

	bne	$t5, $t6, solve_encode_bottom_row_for

solve_encode_bottom_row_for_done:
	beq	$t4, $zero, solve_return	# check if bottom_row_bits is 0, if so return

solve_encode_puzzle:
	sll	$t8, $t8, ENCODED_ROW_WIDTH	# puzzle_bits = dimension_id << 8
	add	$t8, $t8, $t4			# puzzle_bits += bottom_row_bits
	sll	$t8, $t8, 1			# puzzle_bits *= 2 (convert to short index)

solve_lookup_top_row_bits:
	lhu	$s0, puzzle_table($t8)		# top_row_bits = puzzle_table[puzzle_bits]

	li	$s2, 1				# cell_mask = 1
	or	$s2, $s2, $s1			# cell_mask |= cell_bit_width
						# (cell_mask = (cell_bit_width == 1) ? 0b1 : 0b11)

	sub	$s3, $t1, 1			# col = num_cols - 1

solve_apply_top_row_for:
	and	$a2, $s0, $s2			# arg 2: action_num = top_row_bits & cell_mask
	sb	$a2, solution($s3)		# solution[col] = action_num

### TOGGLE LIGHT
#jal	toggle_light				# toggle_light(row, col, actions)

    ## Variables corresponding to registers:

    ##
    ##	  $t6 = tmp_var
    ##	  $t5 = array_index
    ##	  $t4 = cond_var
    ##	  $a3 = board
    ##	  $s8 = num_colors
    ##	  $s7 = num_cols
    ##	  $s6 = num_rows
    ##	  $a2 = action_num
    ##	  $s3 = col
    ##	  $zero = row
    ##
	## End aliases

	#lw	$t0, num_rows			# now $s6
	#lw	$t1, num_cols			# now $s7
	#lw	$t2, num_colors			# now $s8
	#la	$t3, puzzle_board		# now $a3

	# assign  $t5 = $a3&[$zero * $s7 + $s3]
	add	$t5, $s3, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

solve_toggle_light_col_greater_if:
	blez	$s3, solve_toggle_light_row_less_if

	# assign  $t5 = $a3&[($zero) * $s7 + $s3 - 1]
	sub	$t5, $s3, 1
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

solve_toggle_light_row_less_if:
	# assign  $t4 = $s6 - 1
	addi	$t4, $s6, -1
	bge	$zero, $t4, solve_toggle_light_col_less_if

	# assign  $t5 = $a3&[($zero + 1) * $s7 + $s3]
	add	$t5, $s7, $s3
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

solve_toggle_light_col_less_if:
	# assign  $t4 = $s7 - 1
	addi	$t4, $s7, -1
	bge	$s3, $t4, solve_toggle_light_end

	# assign  $t5 = $a3&[($zero) * $s7 + $s3 + 1]
	addi	$t5, $s3, 1
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

solve_toggle_light_end:

### END TOGGLE LIGHT

	srl	$s0, $s0, $s1			# top_row_bits >>= cell_bit_width

	sub	$s3, $s3, 1			# --col

	bgez	$s3, solve_apply_top_row_for

solve_apply_top_row_for_done:
	jal	chase_lights

solve_return:
	lw	$ra, 0($sp)
	lw	$s0, 4($sp) 
	lw	$s1, 8($sp)
	lw	$s2, 12($sp)
	lw	$s3, 16($sp)
	add	$sp, $sp, 20

	jr	$ra


.globl chase_lights
chase_lights:
	sub	$sp, $sp, 28
	sw	$ra, 0($sp)
	sw	$s0, 4($sp) 
	sw	$s1, 8($sp)
	sw	$s2, 12($sp)
	sw	$s3, 16($sp)
	sw	$s4, 20($sp)
	sw	$s5, 24($sp)

	lw	$s0, num_rows				# load num_rows
	lw	$s1, num_cols				# load num_cols
	lw	$s2, num_colors				# load num_colors

	li	$s5, 0					# puzzle_index = 0

	li	$s3, 1					# row = 1
chase_lights_row_for:
	# while (row < num_rows)

	li	$s4, 0					# col = 0
chase_lights_col_for:
	# while (col < num_cols)

	lbu	$t0, puzzle_board($s5)			# state = puzzle_board[puzzle_index]
	beq	$t0, $zero, chase_lights_col_for_nolight# if (state == 0) skip toggle light

	sub	$a2, $s2, $t0				# arg 2: actions = num_colors - state

	add	$t1, $s5, $s1				# next_row_index = puzzle_index + num_cols

	lbu	$t2, solution($t1)			# prev_soln = solution[next_row_index]
	add	$t2, $t2, $a2				# prev_soln += actions
	#rem	$t2, $t2, $s2				# prev_soln %= num_colors (not necessary b/c soln still valid)
	sb	$t2, solution($t1)			# solution[next_row_index] = prev_soln

#move	$a0, $s3				# arg 0: row
#move	$a1, $s4				# arg 1: col

### TOGGLE LIGHT
#jal	toggle_light				# toggle_light(row, col, actions)

    ## Variables corresponding to registers:

    ##
    ##	  $t6 = tmp_var
    ##	  $t5 = array_index
    ##	  $t4 = cond_var
    ##	  $a3 = board
    ##	  $s8 = num_colors
    ##	  $s7 = num_cols
    ##	  $s6 = num_rows
    ##	  $a2 = action_num
    ##	  $s4 = col
    ##	  $s3 = row
    ##
	## End aliases

	#lw	$t0, num_rows			# now $s6
	#lw	$t1, num_cols			# now $s7
	#lw	$t2, num_colors			# now $s8
	#la	$t3, puzzle_board		# now $a3

	# assign  $t5 = $a3&[$s3 * $s7 + $s4]
	mul	$t5, $s3, $s7
	add	$t5, $t5, $s4
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

chase_lights_toggle_light_row_greater_if:
	blez	$s3, chase_lights_toggle_light_col_greater_if

	# assign  $t5 = $a3&[($s3 - 1) * $s7 + $s4]
	addi	$t5, $s3, -1
	mul	$t5, $t5, $s7
	add	$t5, $t5, $s4
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	#lbu	$t6, 0($t5)
	#add	$t6, $t6, $a2
	#div	$t6, $s8
	#mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$zero, 0($t5)

chase_lights_toggle_light_col_greater_if:
	blez	$s4, chase_lights_toggle_light_row_less_if

	# assign  $t5 = $a3&[($s3) * $s7 + $s4 - 1]
	mul	$t9, $s3, $s7
	add	$t9, $t9, $s4
	addi	$t5, $t9, -1
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

chase_lights_toggle_light_row_less_if:
	# assign  $t4 = $s6 - 1
	addi	$t4, $s6, -1
	bge	$s3, $t4, chase_lights_toggle_light_col_less_if

	# assign  $t5 = $a3&[($s3 + 1) * $s7 + $s4]
	addi	$t5, $s3, 1
	mul	$t5, $t5, $s7
	add	$t5, $t5, $s4
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

chase_lights_toggle_light_col_less_if:
	# assign  $t4 = $s7 - 1
	addi	$t4, $s7, -1
	bge	$s4, $t4, chase_lights_toggle_light_end

	# assign  $t5 = $a3&[($s3) * $s7 + $s4 + 1]
	mul	$t5, $s3, $s7
	add	$t5, $t5, $s4
	addi	$t5, $t5, 1
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

chase_lights_toggle_light_end:

### END TOGGLE LIGHT

chase_lights_col_for_nolight:
	add	$s5, $s5, 1				# puzzle_index += 1
	add	$s4, $s4, 1				# col += 1

	bne	$s4, $s1, chase_lights_col_for

chase_lights_col_for_done:
	add	$s3, $s3, 1				# row += 1

	bne	$s3, $s0, chase_lights_row_for

chase_lights_row_for_done:
	lw	$ra, 0($sp)
	lw	$s0, 4($sp)
	lw	$s1, 8($sp)
	lw	$s2, 12($sp)
	lw	$s3, 16($sp)
	lw	$s4, 20($sp)
	lw	$s5, 24($sp)
	add	$sp, $sp, 28

	jr	$ra


